import logo from './logo.svg';
import { Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Home from "./Pages/Home"
import dashboard from "./Pages/Dashboard"

function App() {
  return (
    <Router>
        <Routes>
            <Route path="/" element={ <Home /> }/>
        </Routes>
    </Router>
  );
}

export default App;
